mutation CreateIssue($teamId: String!, $title: String!, $projectId: String, $description: String, $priority: Int) {
  issueCreate(
    input: {teamId: $teamId, projectId: $projectId, title: $title, description: $description, priority: $priority}
  ) {
    __typename
    success
  }
}

f2dcc063202a24bb27350dc7e3afe9494dcef12d.source:
query GetTeamIssues($teamId: String!, $first: Int, $after: String) {
  team(id: $teamId) {
    __typename
    id
    issues(first: $first, after: $after) {
      __typename
      nodes {
        __typename
        id
        title
        estimate
        createdAt
        updatedAt
        archivedAt
        description
        assignee {
          __typename
          id
          name
        }
      }
    }
  }
}

d31296a981ec59c904e044b4ae9f2031e4da75b4.source:
query GetTeams($first: Int, $after: String) {
  teams(first: $first, after: $after) {
    __typename
    nodes {
      __typename
      id
      name
      description
    }
  }
}
